import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { Link } from 'react-scroll';

const HeaderContainer = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  z-index: 1000;
  transition: all 0.3s ease;
`;

const Nav = styled.nav`
  background-color: ${props => props.$scrolled ? 'rgba(26, 26, 26, 0.95)' : 'transparent'};
  padding: 1.5rem 0;
  backdrop-filter: ${props => props.$scrolled ? 'blur(10px)' : 'none'};
  transition: all 0.3s ease;
`;

const NavContent = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const Logo = styled.div`
  font-family: ${props => props.theme.fonts.secondary};
  font-size: 2rem;
  font-weight: 700;
  color: ${props => props.theme.colors.primary};
  cursor: pointer;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 2rem;
  align-items: center;

  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    display: none;
  }
`;

const NavLink = styled(Link)`
  color: ${props => props.theme.colors.text};
  font-size: 1rem;
  font-weight: 500;
  cursor: pointer;
  transition: color 0.3s ease;

  &:hover {
    color: ${props => props.theme.colors.primary};
  }
`;

const AppointmentButton = styled(Link)`
  background-color: ${props => props.theme.colors.primary};
  color: ${props => props.theme.colors.secondary};
  padding: 0.8rem 1.5rem;
  border-radius: 30px;
  font-weight: 600;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 5px 15px rgba(212, 175, 55, 0.3);
  }
`;

const MobileMenuButton = styled.button`
  display: none;
  background: none;
  border: none;
  color: ${props => props.theme.colors.text};
  font-size: 1.5rem;
  cursor: pointer;

  @media (max-width: ${props => props.theme.breakpoints.mobile}) {
    display: block;
  }
`;

const MobileMenu = styled.div`
  display: ${props => props.$isOpen ? 'flex' : 'none'};
  flex-direction: column;
  position: fixed;
  top: 80px;
  left: 0;
  width: 100%;
  background-color: rgba(26, 26, 26, 0.95);
  backdrop-filter: blur(10px);
  padding: 2rem;
  gap: 1.5rem;

  @media (min-width: ${props => props.theme.breakpoints.mobile}) {
    display: none;
  }
`;

function Header() {
  const [scrolled, setScrolled] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <HeaderContainer>
      <Nav $scrolled={scrolled}>
        <NavContent>
          <Logo>FABULOUS</Logo>
          <NavLinks>
            <NavLink to="about" smooth={true} duration={500}>À propos</NavLink>
            <NavLink to="portfolio" smooth={true} duration={500}>Portfolio</NavLink>
            <NavLink to="services" smooth={true} duration={500}>Services</NavLink>
            <NavLink to="testimonials" smooth={true} duration={500}>Témoignages</NavLink>
            <AppointmentButton to="appointment" smooth={true} duration={500}>
              Rendez-vous
            </AppointmentButton>
          </NavLinks>
          <MobileMenuButton onClick={() => setMobileMenuOpen(!mobileMenuOpen)}>
            ☰
          </MobileMenuButton>
        </NavContent>
      </Nav>

      <MobileMenu $isOpen={mobileMenuOpen}>
        <NavLink to="about" smooth={true} duration={500} onClick={() => setMobileMenuOpen(false)}>
          À propos
        </NavLink>
        <NavLink to="portfolio" smooth={true} duration={500} onClick={() => setMobileMenuOpen(false)}>
          Portfolio
        </NavLink>
        <NavLink to="services" smooth={true} duration={500} onClick={() => setMobileMenuOpen(false)}>
          Services
        </NavLink>
        <NavLink to="testimonials" smooth={true} duration={500} onClick={() => setMobileMenuOpen(false)}>
          Témoignages
        </NavLink>
        <AppointmentButton to="appointment" smooth={true} duration={500} onClick={() => setMobileMenuOpen(false)}>
          Rendez-vous
        </AppointmentButton>
      </MobileMenu>
    </HeaderContainer>
  );
}

export default Header;
